function SearchObitContent(options){var root=$("#"+options.RootID);function DoSearch(specificDate){var queryString=GetSearchQueryString(specificDate);if(queryString!=""){window.top.location=options.ObituarySearchUrlPattern.replace("{0}",queryString);}return true;}function DoSearchMore(){var queryString="isnew=1&"+GetSearchQueryString();window.top.location=options.ObituarySearchUrlPattern.replace("{0}",queryString);return true;}function DateRangeChanged(elem){if($(elem).val()==options.DateRangeSpecificDateValue){options.CalendarImg.datepicker("show");}if($(elem).val()==options.DateRangeRangeValue){DoSearch();}}function GetSearchQueryString(specificDate){queryString="affiliateId="+options.AffiliateId;if(options.ShowExpandedSearch){var searchRange=options.SearchDateRange.val();queryString=queryString.concat("&daterange=",searchRange);if(searchRange==options.DateRangeSpecificDateValue&&specificDate!=null){var specificdate=$.datepicker.parseDate(options.AffiliateDateFormat,specificDate);queryString=queryString.concat("&specificdate=",specificdate.getFullYear().toString()+LeftPad((specificdate.getMonth()+1).toString(),"0",2)+LeftPad(specificdate.getDate().toString(),"0",2));}if(searchRange==options.DateRangeRangeValue){var affilatedate=options.AffiliateMaxDate.getFullYear().toString()+LeftPad((options.AffiliateMaxDate.getMonth()+1).toString(),"0",2)+LeftPad(options.AffiliateMaxDate.getDate().toString(),"0",2);queryString=queryString.concat("&startdate=",affilatedate);queryString=queryString.concat("&enddate=",affilatedate);}if(options.FirstNameExpanded.val()!="First Name"&&root.find("#rbPerson").get(0).checked){queryString=queryString.concat("&firstname=",options.FirstNameExpanded.val());}if(options.LastNameExpanded.val()!="Last Name"&&root.find("#rbPerson").get(0).checked){queryString=queryString.concat("&lastname=",options.LastNameExpanded.val());}if(options.TownName.val()!="Enter town name"&&root.find("#rbTown").get(0).checked){queryString=queryString.concat("&townname=",options.TownName.val());}if(options.Keyword.val()!="Keyword"){queryString=queryString.concat("&keyword=",options.Keyword.val());}}else{if(options.FirstNameLimited.val()!="First Name"){queryString=queryString.concat("&firstname=",options.FirstNameLimited.val());}if(options.LastNameLimited.val()!="Last Name"){queryString=queryString.concat("&lastname=",options.LastNameLimited.val());}}queryString=queryString.concat("&stateid=",options.AffiliateStateId);return queryString;}with(this){root.find(":input").bind("keypress",null,function(e){if(e.keyCode=="13"){DoSearch();}});options.SearchDateRange.bind("change",function(){DateRangeChanged(this);});root.find("#lnkSearch").bind("click",DoSearch);root.find("#SearchButtonLink").bind("click",DoSearch);options.SearchMore.find(".SearchMoreLink").bind("click",DoSearchMore);options.AdvancedSearch.find(".SearchMoreLink").bind("click",DoSearchMore);$(document).ready(function(){root.find("#rbPerson").bind("click",function(){InitWatermarkText();root.find("#trTown").hide();root.find("#trPerson").show();options.TownName.val("");});root.find("#rbTown").bind("click",function(){InitWatermarkText();root.find("#trPerson").hide();root.find("#trTown").show();options.FirstNameExpanded.val("");options.LastNameExpanded.val("");});root.find("#rbPerson").attr("checked",true);InitWatermarkText();InitFilteredTextboxes();options.CalendarImg.datepicker({showOn:"button",buttonImage:options.CalendarImgIconUrl,buttonImageOnly:true,dateFormat:options.AffiliateDateFormat,altFormat:options.AffiliateDateFormat,maxDate:options.AffiliateMaxDate,minDate:new Date(2001,0,1),onSelect:calendarDateSelected,buttonText:"Calendar",beforeShow:moveCalendarToTop});function moveCalendarToTop(input,inst){var divPos=$(window).height()-($(input).position().top-$(window).scrollTop());var mTop="-135px";if(divPos>180){$("#ui-datepicker-div").css("margin-top",mTop);}else{$("#ui-datepicker-div").css("margin-top","0px");}}function calendarDateSelected(dateText,inst){options.SearchDateRange.val(options.DateRangeSpecificDateValue);DoSearch(dateText);}function InitWatermarkText(){options.FirstNameExpanded.watermark({watermarkText:"First Name"});options.FirstNameLimited.watermark({watermarkText:"First Name"});options.LastNameExpanded.watermark({watermarkText:"Last Name"});options.LastNameLimited.watermark({watermarkText:"Last Name"});options.TownName.watermark({watermarkText:"Enter town name"});options.Keyword.watermark({watermarkText:"Keyword"});}function InitFilteredTextboxes(){options.FirstNameExpanded.filteredtextbox();options.FirstNameLimited.filteredtextbox();options.LastNameExpanded.filteredtextbox();options.LastNameLimited.filteredtextbox();options.TownName.filteredtextbox();options.Keyword.filteredtextbox({filter:"[A-Za-z0-9-.'\" ]"});}});}}function LeftPad(originalStr,padChar,finalLength){var lengthDiff=finalLength-originalStr.toString().length;if(lengthDiff>0){var padding="";for(var i=0;i<lengthDiff;i++){padding+=padChar;}return padding+originalStr;}return originalStr;}
